'use strict';

/* globals module */
var out_app_engine_dir = 'out/app_engine';
var app_engine_path = 'temp/google-cloud-sdk/platform/google_appengine'
// Check if running on travis, if so do not install in User due to using
// pythonEnv.
var isTravis = ('TRAVIS' in process.env && 'CI' in process.env) ?
    '' : '--user';

module.exports = function(grunt) {
  require('load-grunt-tasks')(grunt);

  // configure project
  grunt.initConfig({
    // make node configurations available
    pkg: grunt.file.readJSON('package.json'),

    csslint: {
      options: {
        csslintrc: 'build/.csslintrc'
      },
      strict: {
        options: {
          import: 2
        },
        src: ['src/**/*.css'
        ]
      },
      lax: {
        options: {
          import: false
        },
        src: ['src/**/*.css'
        ]
      }
    },

    htmllint: {
      all: {
        src: [
          'src/**/*_template.html'
        ]
      }
    },
    eslint: {
      options: {
        configFile: 'build/.eslintrc'
      },
      target: ['src/**/*.js', '!src/**/enums.js', '!src/**/adapter.js' ]
    },

    shell: {
      pipInstall : {
        command: ['pip install', isTravis, '--requirement requirements.txt']
            .join(' ')
      },
      ensureGcloudSDKIsInstalled: {
        command: 'python build/ensure_gcloud_sdk_is_installed.py'
      },
      runPythonTests: {
        command: ['python', 'build/run_python_tests.py',
                  app_engine_path, out_app_engine_dir].join(' ')
      },
      buildAppEnginePackage: {
        command: ['python', './build/build_app_engine_package.py', 'src',
                  out_app_engine_dir].join(' ')
      },
      buildAppEnginePackageWithTests: {
        command: ['python', './build/build_app_engine_package.py', 'src',
                  out_app_engine_dir, '--include-tests'].join(' ')
      },
      removePythonTestsFromOutAppEngineDir: {
        command: ['python', './build/remove_python_tests.py',
                  out_app_engine_dir].join(' ')
      },
      genJsEnums: {
        command: ['python', './build/gen_js_enums.py', 'src',
                  'src/web_app/js'].join(' ')
      },
      copyAdapter: {
        command: ['python', './build/copy_portable.py',
                  'node_modules/webrtc-adapter/out/adapter.js',
                  'src/web_app/js/adapter.js'].join(' ')
      },
      copyJsFiles: {
        command: ['python', './build/copy_js_files.py',
                  'src/web_app/js', out_app_engine_dir + '/js'].join(' ')
      },
      runUnitTests: {
        command: 'bash ./build/start-tests.sh'
      },
    },
    karma: {
      unit: {
        configFile: 'karma.conf.js'
      }
    }
  });

  // Set default tasks to run when grunt is called without parameters.
  grunt.registerTask('default', ['runLinting', 'runPythonTests', 'build',
                                 'runUnitTests']);
  grunt.registerTask('runLinting', ['csslint', 'eslint']);
  grunt.registerTask('runPythonTests', ['shell:pipInstall',
                                        'shell:ensureGcloudSDKIsInstalled',
                                        'shell:buildAppEnginePackageWithTests',
                                        'shell:runPythonTests',
                                        'shell:removePythonTestsFromOutAppEngineDir']);
  grunt.registerTask('runUnitTests', [
                     'shell:genJsEnums', 'shell:copyAdapter', 'shell:runUnitTests']),
  grunt.registerTask('build', ['shell:buildAppEnginePackage',
                               'shell:genJsEnums',
                               'shell:copyAdapter',
                               'shell:copyJsFiles']);
};

// Karma configuration
module.exports = function(config) {
  var browser = (process.env.BROWSER === '' || process.env.BROWSER === 'chrome')
      ? 'Chrome_no_sandbox' : process.env.BROWSER
  var travis = process.env.TRAVIS;
  var files = function() {
    // List of tests that can run in 'any' browser.
    var filteredFiles = [
      // Application files.
      'src/web_app/js/adapter.js',
      'src/web_app/js/constants.js',
      'src/web_app/js/util.js',
      'src/web_app/js/sdputils.js',
      'src/web_app/js/enums.js',
      'src/web_app/js/analytics.js',
      'src/web_app/js/appcontroller.js',
      'src/web_app/js/appwindow.js',
      'src/web_app/js/call.js',
      'src/web_app/js/infobox.js',
      'src/web_app/js/loopback.js',
      'src/web_app/js/peerconnectionclient.js',
      'src/web_app/js/roomselection.js',
      'src/web_app/js/signalingchannel.js',
      'src/web_app/js/stats.js',
      'src/web_app/js/storage.js',
      'src/web_app/js/windowport.js',
      // Test files.
      'src/web_app/js/testpolyfills.js',
      'src/web_app/js/test_mocks.js',
      'src/web_app/js/appcontroller_test.js',
      'src/web_app/js/analytics_test.js',
      'src/web_app/js/call_test.js',
      'src/web_app/js/infobox_test.js',
      'src/web_app/js/peerconnectionclient_test.js',
      'src/web_app/js/remotewebsocket_test.js',
      'src/web_app/js/roomselection_test.js',
      'src/web_app/js/sdputils_test.js',
      'src/web_app/js/signalingchannel_test.js',
      'src/web_app/js/utils_test.js'
    ];
    return filteredFiles;
  }

  let chromeFlags = [
    '--use-fake-device-for-media-stream',
    '--use-fake-ui-for-media-stream',
    '--no-sandbox',
    '--headless', '--disable-gpu', '--remote-debugging-port=9222'
  ];
  config.set({

    // base path that will be used to resolve all patterns (eg. files, exclude)
    basePath: '',

    // frameworks to use
    // available frameworks: https://npmjs.org/browse/keyword/karma-adapter
    frameworks: ['jasmine'],

    // list of files / patterns to load in the browser
    // Make sure to have them in the correct order.
    files: files(),

    // list of files to exclude
    exclude: [
    ],

    // preprocess matching files before serving them to the browser
    // available preprocessors:
    // https://npmjs.org/browse/keyword/karma-preprocessor
    preprocessors: {
      // Enable this with the autoWatch feature below if you want eslint to run
      // on each file change.
      // 'src/web_app/js/*.js': ['eslint']
    },

    eslint: {
      stopOnError: false,
      stopOnWarning: false,
      showWarnings: true,
      engine: {
        configFile: 'build/.eslintrc'
      }
    },

    // Capture browser JavaScript console log output.
    client: {
      // Enable console capture on travis only.
      captureConsole: (travis) ? true : false
    },

    // test results reporter to use
    // possible values: 'dots', 'progress'
    // available reporters: https://npmjs.org/browse/keyword/karma-reporter
    reporters: ['progress'],

    // web server port
    port: 9876,

    // enable / disable colors in the output (reporters and logs)
    colors: true,

    // level of logging
    // possible values: config.LOG_DISABLE || config.LOG_ERROR ||
    // config.LOG_WARN || config.LOG_INFO || config.LOG_DEBUG
    // Enable full logging on travis only.
    logLevel: (travis) ? config.LOG_DEBUG : config.LOG_DISABLE,

    // enable / disable watching file and executing tests whenever any file
    // changes
    autoWatch: false,

    // start these browsers
    // available browser launchers:
    // https://npmjs.org/browse/keyword/karma-launcher
    browsers: [browser[0].toUpperCase() + browser.substr(1)],

    customLaunchers: {
      Chrome_no_sandbox: {
        base: 'Chrome',
        flags: chromeFlags
      }
    },

    // Continuous Integration mode
    // if true, Karma captures browsers, runs the tests and exits
    singleRun: true,

    // Concurrency level
    // how many browser should be started simultaneous
    concurrency: 1
  })
}

